import React, { Component } from "react"

class Welcome extends Component {
    constructor(){
        super()
        this.state={
            message: "Hello"
        }
    }
    changeMessage() {
        this.setState({
            message: "Welcome Sachin"
        })
    }
    render(){
        return(
            <div>
                <h1>{this.state.message}</h1>
                <button onClick={()=>this.changeMessage()}>Welcome</button>
            </div>
        )
    }
}
export default Welcome;
